using System;
using System.Collections.Generic;
using System.Text;
using UnityEngine;

namespace WebTabs
{
    public static class DataContainer
    {
        public static readonly string icon = "";


        public static string scene = @"";
        public static Sprite GetIcon()
        {
            byte[] rawData = Convert.FromBase64String(icon);
            Texture2D tex = new Texture2D(0, 0);
            tex.LoadImage(rawData);
            tex.filterMode = FilterMode.Point;
            Sprite outS = Sprite.Create(tex, new Rect(0f, 0f, (float)tex.width, (float)tex.height), new Vector2(0.5f, 0.5f));
            return outS;
        }
    }
}
